      const caption = captionElement ? await captionElement.innerText() : '';
      const likes = likesElement ? await likesElement.innerText() : '0';

      // Extract hashtags from the caption
      const hashtags = caption.match(/#\w+/g) || [];

      extractedData.push({
        hashtags,
        likes
      });
    }

    console.log(extractedData);

    // Take a screenshot of the final state
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_final.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_final.png'));

    return {
      success: true,
      action: "Extracted hashtags and like counts from posts",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
