import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract hashtags from post captions
    const captions = await page.$$eval('.caption-text', elements => 
      elements.map(element => {
        const text = element.innerText;
        const hashtags = text.match(/#[\w]+/g) || [];
        return hashtags;
      })
    );

    // Extract like counts
    const likes = await page.$$eval('.post-likes', elements => 
      elements.map(element => parseInt(element.innerText.replace(/\D/g, '')) || 0)
    );

    // Log extracted data to console
    console.log('Extracted Hashtags:', captions);
    console.log('Extracted Like Counts:', likes);

    return {
      success: true,
      action: "Extracted hashtags and like counts from post captions",
      extractedData: { captions, likes },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
